import React from 'react'
import Cookies from 'js-cookie'
import { Link } from 'react-router-dom'

const Logout = () => {

  const id = Cookies.get('id')
  let button

  if (!id) {
    button = <li><Link to="/login">Login</Link></li>
  } else {
    button = <button>Logout</button>
  }

  return (
    <div>
      {button}
    </div>
    )

}

export default Logout
